  HOME: 'home_page',
  PROFILE: 'profile_page',
  EDIT_PROFILE: 'edit_page',
  SIGNIN: 'signin_page',
  LOGIN: 'login_page',
};

export default function NavigationPanel(props) {
  return (
    <nav>
      <ul>
        {props.isConnected && (
          <>
            <li>
              <a
                href="#"
                onClick={() => props.setCurrentPage(PAGES.HOME)}
